import React from 'react'

const StartRating = () => {
  const containerStyle={
    display: "flex",
    alignment: "center",
    gap:"16px"
  };

  return (
    <div style={containerStyle}>
      <div>
        {Array.from({ length: 5 }, (_, i) =>(
           <span key={i}>S{i + 1}</span>
           ))}
      </div>
      <p></p>
    </div>
  )
}

export default StartRating
